"use strict";
/*
    Type Aliases
    Type Aliases allow defining types with a custom name (an Alias).
    Type Aliases can be used for primitives like string or more complex types such as objects and arrays:
*/
const toyota = 'toyota';
const std = {
    name: 'ISongwut',
    age: 10,
    car: toyota
};
const std_2 = {
    name: 'ISongwut',
    age: 10,
    car: toyota
};
const std_3 = {
    name: 'ISongwut',
    age: 10,
    car: toyota,
    degree: 'Bachelor'
};
